export default class About extends Component {
	render() {
		// console.log('About组件收到的props是',this.props);
		return (
			// <h3>环保厅</h3>
			<HomeVideoBtn
				videosrc="http://202.119.249.152:8080/resource/App_f8b7037098e44e438c85cfca01eadfdc/statics/videos/EthyleneGlycol.mp4"
